package com.practice;

public class Abbreviation {

	public static void main(String[] args) {
		//String a = "";
		//String b = "";
		
		String a ="";
		String b = "";
		
		a ="";
		b="";
		
		a = "abcd";
		b="AXE";
		
		if(a.length()<b.length()) {
			return;
		}
		
		a = a.toUpperCase();
		
		System.out.println(a);
		System.out.println(b);
		
		int pos = -1;
		int matched = 0;
		for(int i=0; i<b.length(); i++) {
			if(pos+1 == a.length()) {
				System.out.println(b.charAt(i) + "~~~" + pos);
				break;
			}
			
			pos = a.indexOf(b.charAt(i),pos +1);
			if(pos==-1) {
				System.out.println(b.charAt(i) + "~~~" + pos);
				break;
			}
			if(i==b.length()-1) {
				matched = 1;
			}
		}
		
		if(matched==1) {
			System.out.println("YES");
		} else {
			System.out.println("NO");
		}
		
		int x = 20000;
		int y=500;
		x |=y;
		System.out.println(x);
	}

}
